import React, { useState } from "react";
import { Calendar, momentLocalizer } from "react-big-calendar";
import "react-big-calendar/lib/css/react-big-calendar.css";
import moment from "moment";
import "moment/locale/nb";

const localizer = momentLocalizer(moment);

const MyCalendar = props => {
  const [events, setEvents] = useState([
    {
      id: 0,
      title: "All Day Event very long title",
      allDay: true,
      start: new Date(2022, 0, 1),
      end: new Date(2022, 0, 2)
    },
    {
      id: 2,
      title: "All Day Event very long title",
      allDay: true,
      start: new Date(2022, 0, 5),
      end: new Date(2022, 0, 8)
    },
    {
      id: 3,
      title: "All Day Event very long title",
      allDay: true,
      start: new Date(2022, 0, 7),
      end: new Date(2022, 0, 9)
    },
    {
      id: 4,
      title: "All Day Event very long title",
      allDay: true,
      start: new Date(2022, 0, 15),
      end: new Date(2022, 0, 21)
    },
    {
      id: 5,
      title: "eVENT",
      allDay: true,
      start: new Date(2022, 0, 12),
      end: new Date(2022, 0, 12)
    },
    {
      id: 1,
      title: "Long Event",
      start: new Date(2022, 0, 27),
      end: new Date(2022, 0, 30)
    }
  ]);
  return (
    <div style={{ height: 590 }}>
      <Calendar
        localizer={localizer}
        culture="en-GB"
        views={["month", "week", "day", "agenda"]}
        events={events}
        startAccessor="start"
        endAccessor="end"
      />
    </div>
  );
};

export default MyCalendar;
